window.bookSummaryJSON = "<p>\"You say I'll never own you. If I win - you willingly give me that right. You sign not only the debt agreement, but another - one that makes me your master until your last breath is taken. You do that, and I'll give you this.\" </p> <p>Nila Weaver's family is indebted. Stolen, taken, and bound not by monsters but by an agreement written over 600 years ago, she has no way out. </p> <p>She belongs to Jethro as much as she denies it. </p> <p>Jethro Hawk's patience is running out. His inheritance gift tests, challenges, and surprises him - and not in good ways. He hasn't leashed her but he thinks he might've found a way to bind her forever. </p> <p>Debts are mounting. Payment waiting. </p>"; 
